import React from 'react';
import {NavLink, Route, BrowserRouter} from 'react-router-dom';
import s from './EquipNavbar.module.css';

const EquipNavbar = ()=> {
    return (
        <div>
            <h2 className={s.title}>Наше оборудование</h2>

            <BrowserRouter className={s.list}>
                <Route className={s.nav__item}>
                    <NavLink to>

                    </NavLink>
                </Route>
                <Route className={s.nav__item}></Route>
                <Route className={s.nav__item}></Route>
                <li className={s.nav__item}></li>
            </BrowserRouter>
        </div>
    )
}

export default EquipNavbar;
